import React, { useState, useEffect } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import DateFilter from '../../components/DateFilter/DateFilter';
import './Dashboard.css';

const ReceptionistDashboard = () => {
  const [stats, setStats] = useState({
    patientsRegistered: 0,
    totalAppointments: 0,
    pendingQueue: 0
  });

  const [todayQueue, setTodayQueue] = useState([]);
  const [billingSummary, setBillingSummary] = useState([]);
  const [dateRange, setDateRange] = useState({ 
    startDate: new Date().toISOString().split('T')[0], 
    endDate: new Date().toISOString().split('T')[0], 
    range: 'today' 
  });

  const handleDateChange = (newDateRange) => {
    setDateRange(newDateRange);
    fetchDashboardData(newDateRange.startDate, newDateRange.endDate);
  };

  useEffect(() => {
    fetchDashboardData();
  }, [dateRange]);

  const fetchDashboardData = async (startDate = dateRange.startDate, endDate = dateRange.endDate) => {
    try {
      const url = `http://localhost:5000/api/receptionist/dashboard-summary?startDate=${startDate}&endDate=${endDate}`;
      const response = await fetch(url, {
        credentials: 'include'
      });
      const data = await response.json();
      setStats(data.stats);
      setBillingSummary(data.billingSummary || []);

      // Fetch today's queue
      const queueResponse = await fetch('http://localhost:5000/api/receptionist/queue', {
        credentials: 'include'
      });
      const queueData = await queueResponse.json();
      setTodayQueue(queueData.slice(0, 5).map(q => ({
        department: q.patient?.department || 'N/A',
        patient: q.patient_name,
        status: q.status
      })));
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    }
  };

  return (
    <div className="page-container">
      <div className="page-header">
        <h1>Receptionist Dashboard</h1>
        <p>Welcome back! Here's what's happening</p>
      </div>

      <DateFilter onDateChange={handleDateChange} selectedRange={dateRange.range} />

      <div className="stats-grid">
        <div className="stat-card">
          <div className="stat-icon">👥</div>
          <div className="stat-content">
            <div className="stat-value">{stats.patientsRegistered}</div>
            <div className="stat-label">Patients Registered</div>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">📅</div>
          <div className="stat-content">
            <div className="stat-value">{stats.totalAppointments}</div>
            <div className="stat-label">Total Appointments</div>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">👥</div>
          <div className="stat-content">
            <div className="stat-value">{stats.pendingQueue}</div>
            <div className="stat-label">Pending Queue</div>
          </div>
        </div>
      </div>

      <div className="recent-section">
        <div className="card">
          <h3>Today's Queue</h3>
          <div className="table-header">
            <span>Department</span>
            <span>Patient</span>
            <span>Status</span>
          </div>
          {todayQueue.length === 0 ? (
            <div className="no-data">
              <p>No patients in queue</p>
            </div>
          ) : (
            todayQueue.map((item, index) => (
              <div key={index} className="table-row">
                <span>{item.department}</span>
                <span>{item.patient}</span>
                <span className="status-badge">{item.status}</span>
              </div>
            ))
          )}
        </div>
      </div>

      <div className="charts-section">
        <div className="card">
          <h3>Billing Summary</h3>
          <ResponsiveContainer width="100%" height={200}>
            <LineChart data={billingSummary}>
              <CartesianGrid strokeDasharray="3 3" stroke="#2a2d47" />
              <XAxis dataKey="day" axisLine={false} tickLine={false} tick={{ fill: '#a0aec0', fontSize: 12 }} />
              <YAxis axisLine={false} tickLine={false} tick={{ fill: '#a0aec0', fontSize: 12 }} />
              <Tooltip 
                contentStyle={{ 
                  backgroundColor: '#1e1e2f', 
                  border: '1px solid #2a2d47', 
                  borderRadius: '8px',
                  color: '#ccd6f6'
                }} 
              />
              <Line 
                type="monotone" 
                dataKey="amount" 
                stroke="#ffa057" 
                strokeWidth={2} 
                dot={{ fill: '#ffa057', strokeWidth: 2, r: 4 }}
                activeDot={{ r: 6, fill: '#ffa057' }}
              />
            </LineChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );
};

export default ReceptionistDashboard;
